import React from "react";
import "../../App.css";
import VideoPlayer from 'react-video-js-player';
import trailer from '/videos/video-1.mp4';

const videoSrc = trailer;
const poster = "https://i.ytimg.com/vi/9bZkp7q19f0/maxresdefault.jpg";


export default function Trailer() {
    return (
        <div className="trailer">
        <h1>TRAILER</h1>
            <VideoPlayer
                src={videoSrc}
                poster={poster}
                width="720"
                height="480"
                playbackRates={[0.5, 1, 1.5, 2]}
            />
        </div>
    );

}
